import React from "react";

const Home = () => {
    return (
        <>
        <div className="container">
            <div className="row">
                <div className="col-12 col-md-6 ">
                    <img className="logo1-image" src={process.env.PUBLIC_URL + "/Images/image.jpg"} alt="Random_Image" />
                </div>
            </div>
        </div>
        </>
    )
};

export default Home;
